import VueRouter from "vue-router";

import Home from "../pages/Home"
import Login from "../pages/Login"

export default new VueRouter({
    routes:[
        {
            name:'Home',
            path:'/home',
            component:Home
        },
        {
            name:'Login',
            path:'/login',
            component: Login
        }
    ]

})
